import React, { Component } from "react";
import {
MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavItem, MDBNavLink, MDBNavbarToggler, MDBCollapse,
MDBDropdown, MDBDropdownToggle, MDBDropdownMenu, MDBDropdownItem, MDBContainer
} from "mdbreact";

import Logo from '../../statics/images/logo.png';
import './header.css';
import SearchBar from "../ContentArea/Home/SearchBar";

class Header extends Component {
    state = {
        isOpen: false
    };

    toggleCollapse = () => {
        this.setState({ isOpen: !this.state.isOpen });
    }

    render() {
    
    return (
        <MDBNavbar dark expand="md" className="h-navbar">
            <MDBContainer>
                <MDBNavbarBrand>
                    <img src={Logo} alt="Rate Hogs" className="img-fluid" />
                </MDBNavbarBrand>

                <MDBNavbarToggler onClick={this.toggleCollapse} />

                <MDBCollapse id="navbarCollapse3" isOpen={this.state.isOpen} navbar>
                    <MDBNavbarNav center>

                        <SearchBar />

                        <MDBNavItem>
                            <MDBNavLink to="#!">Login</MDBNavLink>
                            <MDBNavLink to="#!">Register</MDBNavLink>
                        </MDBNavItem>
                    </MDBNavbarNav>                
                </MDBCollapse>
            </MDBContainer>    
        </MDBNavbar>
        );
    }
}

export default Header;
